<template><section>

<h2 id="transfer"><a class="header-anchor" href="#transfer" aria-hidden="true">¶</a> Transfer</h2>
<h3 id="basic-usage"><a class="header-anchor" href="#basic-usage" aria-hidden="true">¶</a> Basic usage</h3>
<demo-block class="demo-box" :jsfiddle="{&quot;html&quot;:&quot;&lt;template&gt;\n  &lt;el-transfer v-model=\&quot;value1\&quot; :data=\&quot;data\&quot;&gt;\n  &lt;/el-transfer&gt;\n&lt;/template&gt;\n\n\n&quot;,&quot;script&quot;:&quot;\n  export default {\n    data() {\n      const generateData = _ =&gt; {\n        const data = [];\n        for (let i = 1; i &lt;= 15; i++) {\n          data.push({\n            key: i,\n            label: `Option ${ i }`,\n            disabled: i % 4 === 0\n          });\n        }\n        return data;\n      };\n      return {\n        data: generateData(),\n        value1: [1, 4]\n      };\n    }\n  };\n&quot;,&quot;style&quot;:null}">
                    <div class="source" slot="source"><template>
  <el-transfer v-model="value1" :data="data">
  </el-transfer>
</template>


</div>
                    <p>Data is passed to Transfer via the <code>data</code> attribute. The data needs to be an object array, and each object should have these attributes: <code>key</code> being the identification of the data item, <code>label</code> being the displayed text, and <code>disabled</code> indicating if the data item is disabled. Items inside the target list are in sync with the variable binding to <code>v-model</code>, and the value of that variable is an array of target item keys. So, if you don't want the target list be initially empty, you can initialize the <code>v-model</code> with an array.</p>

                    <div class="highlight" slot="highlight"><pre><code class="hljs language-html"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>
  <span class="hljs-tag">&lt;<span class="hljs-name">el-transfer</span>
    <span class="hljs-attr">v-model</span>=<span class="hljs-string">"value1"</span>
    <span class="hljs-attr">:data</span>=<span class="hljs-string">"data"</span>&gt;</span>
  <span class="hljs-tag">&lt;/<span class="hljs-name">el-transfer</span>&gt;</span>
<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>

<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">
  <span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {
    data() {
      <span class="hljs-keyword">const</span> generateData = <span class="hljs-function"><span class="hljs-params">_</span> =&gt;</span> {
        <span class="hljs-keyword">const</span> data = [];
        <span class="hljs-keyword">for</span> (<span class="hljs-keyword">let</span> i = <span class="hljs-number">1</span>; i &lt;= <span class="hljs-number">15</span>; i++) {
          data.push({
            <span class="hljs-attr">key</span>: i,
            <span class="hljs-attr">label</span>: <span class="hljs-string">`Option <span class="hljs-subst">${ i }</span>`</span>,
            <span class="hljs-attr">disabled</span>: i % <span class="hljs-number">4</span> === <span class="hljs-number">0</span>
          });
        }
        <span class="hljs-keyword">return</span> data;
      };
      <span class="hljs-keyword">return</span> {
        <span class="hljs-attr">data</span>: generateData(),
        <span class="hljs-attr">value1</span>: [<span class="hljs-number">1</span>, <span class="hljs-number">4</span>]
      };
    }
  };
</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>
</code></pre>
</div></demo-block>
<h3 id="filterable"><a class="header-anchor" href="#filterable" aria-hidden="true">¶</a> Filterable</h3>
<p>You can search and filter data items.</p>
<demo-block class="demo-box" :jsfiddle="{&quot;html&quot;:&quot;&lt;template&gt;\n  &lt;el-transfer filterable :filter-method=\&quot;filterMethod\&quot; filter-placeholder=\&quot;State Abbreviations\&quot; v-model=\&quot;value2\&quot; :data=\&quot;data2\&quot;&gt;\n  &lt;/el-transfer&gt;\n&lt;/template&gt;\n\n\n&quot;,&quot;script&quot;:&quot;\n  export default {\n    data() {\n      const generateData2 = _ =&gt; {\n        const data = [];\n        const states = ['California', 'Illinois', 'Maryland', 'Texas', 'Florida', 'Colorado', 'Connecticut '];\n        const initials = ['CA', 'IL', 'MD', 'TX', 'FL', 'CO', 'CT'];\n        states.forEach((city, index) =&gt; {\n          data.push({\n            label: city,\n            key: index,\n            initial: initials[index]\n          });\n        });\n        return data;\n      };\n      return {\n        data2: generateData2(),\n        value2: [],\n        filterMethod(query, item) {\n          return item.initial.toLowerCase().indexOf(query.toLowerCase()) &gt; -1;\n        }\n      };\n    }\n  };\n&quot;,&quot;style&quot;:null}">
                    <div class="source" slot="source"><template>
  <el-transfer filterable="" :filter-method="filterMethod" filter-placeholder="State Abbreviations" v-model="value2" :data="data2">
  </el-transfer>
</template>


</div>
                    <p>Set the <code>filterable</code> attribute to <code>true</code> to enable filter mode. By default, if the data item <code>label</code> contains the search keyword, it will be included in the search result. Also, you can implement you own filter method with the <code>filter-method</code> attribute. It takes a method and passes search keyword and each data item to it whenever the keyword changes. For a certain data item, if the method returns true, it will be included in the result list.</p>

                    <div class="highlight" slot="highlight"><pre><code class="hljs language-html"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>
  <span class="hljs-tag">&lt;<span class="hljs-name">el-transfer</span>
    <span class="hljs-attr">filterable</span>
    <span class="hljs-attr">:filter-method</span>=<span class="hljs-string">"filterMethod"</span>
    <span class="hljs-attr">filter-placeholder</span>=<span class="hljs-string">"State Abbreviations"</span>
    <span class="hljs-attr">v-model</span>=<span class="hljs-string">"value2"</span>
    <span class="hljs-attr">:data</span>=<span class="hljs-string">"data2"</span>&gt;</span>
  <span class="hljs-tag">&lt;/<span class="hljs-name">el-transfer</span>&gt;</span>
<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>

<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">
  <span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {
    data() {
      <span class="hljs-keyword">const</span> generateData2 = <span class="hljs-function"><span class="hljs-params">_</span> =&gt;</span> {
        <span class="hljs-keyword">const</span> data = [];
        <span class="hljs-keyword">const</span> states = [<span class="hljs-string">'California'</span>, <span class="hljs-string">'Illinois'</span>, <span class="hljs-string">'Maryland'</span>, <span class="hljs-string">'Texas'</span>, <span class="hljs-string">'Florida'</span>, <span class="hljs-string">'Colorado'</span>, <span class="hljs-string">'Connecticut '</span>];
        <span class="hljs-keyword">const</span> initials = [<span class="hljs-string">'CA'</span>, <span class="hljs-string">'IL'</span>, <span class="hljs-string">'MD'</span>, <span class="hljs-string">'TX'</span>, <span class="hljs-string">'FL'</span>, <span class="hljs-string">'CO'</span>, <span class="hljs-string">'CT'</span>];
        states.forEach(<span class="hljs-function">(<span class="hljs-params">city, index</span>) =&gt;</span> {
          data.push({
            <span class="hljs-attr">label</span>: city,
            <span class="hljs-attr">key</span>: index,
            <span class="hljs-attr">initial</span>: initials[index]
          });
        });
        <span class="hljs-keyword">return</span> data;
      };
      <span class="hljs-keyword">return</span> {
        <span class="hljs-attr">data2</span>: generateData2(),
        <span class="hljs-attr">value2</span>: [],
        filterMethod(query, item) {
          <span class="hljs-keyword">return</span> item.initial.toLowerCase().indexOf(query.toLowerCase()) &gt; <span class="hljs-number">-1</span>;
        }
      };
    }
  };
</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>
</code></pre>
</div></demo-block>
<h3 id="customizable"><a class="header-anchor" href="#customizable" aria-hidden="true">¶</a> Customizable</h3>
<p>You can customize list titles, button texts, render function for data items, checking status texts in list footer and list footer contents.</p>
<demo-block class="demo-box" :jsfiddle="{&quot;html&quot;:&quot;&lt;template&gt;\n  &lt;el-transfer v-model=\&quot;value3\&quot; filterable=\&quot;\&quot; :left-default-checked=\&quot;[2, 3]\&quot; :right-default-checked=\&quot;[1]\&quot; :render-content=\&quot;renderFunc\&quot; :titles=\&quot;['Source', 'Target']\&quot; :button-texts=\&quot;['To left', 'To right']\&quot; :footer-format=\&quot;{\n      noChecked: '${total}',\n      hasChecked: '${checked}/${total}'\n    }\&quot; @change=\&quot;handleChange\&quot; :data=\&quot;data\&quot;&gt;\n    &lt;el-button class=\&quot;transfer-footer\&quot; slot=\&quot;left-footer\&quot; size=\&quot;small\&quot;&gt;Operation&lt;/el-button&gt;\n    &lt;el-button class=\&quot;transfer-footer\&quot; slot=\&quot;right-footer\&quot; size=\&quot;small\&quot;&gt;Operation&lt;/el-button&gt;\n  &lt;/el-transfer&gt;\n&lt;/template&gt;\n\n\n\n\n&quot;,&quot;script&quot;:&quot;\n  export default {\n    data() {\n      const generateData = _ =&gt; {\n        const data = [];\n        for (let i = 1; i &lt;= 15; i++) {\n          data.push({\n            key: i,\n            label: `Option ${ i }`,\n            disabled: i % 4 === 0\n          });\n        }\n        return data;\n      };\n      return {\n        data: generateData(),\n        value3: [1],\n        renderFunc(h, option) {\n          return &lt;span&gt;{ option.key } - { option.label }&lt;/span&gt;;\n        }\n      };\n    },\n\n    methods: {\n      handleChange(value, direction, movedKeys) {\n        console.log(value, direction, movedKeys);\n      }\n    }\n  };\n&quot;,&quot;style&quot;:&quot;\n  .transfer-footer {\n    margin-left: 20px;\n    padding: 6px 5px;\n  }\n&quot;}">
                    <div class="source" slot="source"><template>
  <el-transfer v-model="value3" filterable="" :left-default-checked="[2, 3]" :right-default-checked="[1]" :render-content="renderFunc" :titles="['Source', 'Target']" :button-texts="['To left', 'To right']" :footer-format="{
      noChecked: '${total}',
      hasChecked: '${checked}/${total}'
    }" @change="handleChange" :data="data">
    <el-button class="transfer-footer" slot="left-footer" size="small">Operation</el-button>
    <el-button class="transfer-footer" slot="right-footer" size="small">Operation</el-button>
  </el-transfer>
</template>




</div>
                    <p>Use <code>titles</code>, <code>button-texts</code>, <code>render-content</code> and <code>footer-format</code> to respectively customize list titles, button texts, render function for data items, checking status texts in list footer. For list footer contents, two named slots are provided: <code>left-footer</code> and <code>right-footer</code>. Plus, if you want some items initially checked, you can use <code>left-default-checked</code> and <code>right-default-checked</code>. Finally, this example demonstrate the <code>change</code> event. Note that this demo can't run in jsfiddle because it doesn't support JSX syntax. In a real project, <code>render-content</code> will work if relevant dependencies are correctly configured.</p>

                    <div class="highlight" slot="highlight"><pre><code class="hljs language-html"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>
  <span class="hljs-tag">&lt;<span class="hljs-name">el-transfer</span>
    <span class="hljs-attr">v-model</span>=<span class="hljs-string">"value3"</span>
    <span class="hljs-attr">filterable</span>
    <span class="hljs-attr">:left-default-checked</span>=<span class="hljs-string">"[2, 3]"</span>
    <span class="hljs-attr">:right-default-checked</span>=<span class="hljs-string">"[1]"</span>
    <span class="hljs-attr">:render-content</span>=<span class="hljs-string">"renderFunc"</span>
    <span class="hljs-attr">:titles</span>=<span class="hljs-string">"['Source', 'Target']"</span>
    <span class="hljs-attr">:button-texts</span>=<span class="hljs-string">"['To left', 'To right']"</span>
    <span class="hljs-attr">:footer-format</span>=<span class="hljs-string">"{
      noChecked: '${total}',
      hasChecked: '${checked}/${total}'
    }"</span>
    <span class="hljs-attr">@change</span>=<span class="hljs-string">"handleChange"</span>
    <span class="hljs-attr">:data</span>=<span class="hljs-string">"data"</span>&gt;</span>
    <span class="hljs-tag">&lt;<span class="hljs-name">el-button</span> <span class="hljs-attr">class</span>=<span class="hljs-string">"transfer-footer"</span> <span class="hljs-attr">slot</span>=<span class="hljs-string">"left-footer"</span> <span class="hljs-attr">size</span>=<span class="hljs-string">"small"</span>&gt;</span>Operation<span class="hljs-tag">&lt;/<span class="hljs-name">el-button</span>&gt;</span>
    <span class="hljs-tag">&lt;<span class="hljs-name">el-button</span> <span class="hljs-attr">class</span>=<span class="hljs-string">"transfer-footer"</span> <span class="hljs-attr">slot</span>=<span class="hljs-string">"right-footer"</span> <span class="hljs-attr">size</span>=<span class="hljs-string">"small"</span>&gt;</span>Operation<span class="hljs-tag">&lt;/<span class="hljs-name">el-button</span>&gt;</span>
  <span class="hljs-tag">&lt;/<span class="hljs-name">el-transfer</span>&gt;</span>
<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>

<span class="hljs-tag">&lt;<span class="hljs-name">style</span>&gt;</span><span class="css">
  <span class="hljs-selector-class">.transfer-footer</span> {
    <span class="hljs-attribute">margin-left</span>: <span class="hljs-number">20px</span>;
    <span class="hljs-attribute">padding</span>: <span class="hljs-number">6px</span> <span class="hljs-number">5px</span>;
  }
</span><span class="hljs-tag">&lt;/<span class="hljs-name">style</span>&gt;</span>

<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">
  <span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {
    data() {
      <span class="hljs-keyword">const</span> generateData = <span class="hljs-function"><span class="hljs-params">_</span> =&gt;</span> {
        <span class="hljs-keyword">const</span> data = [];
        <span class="hljs-keyword">for</span> (<span class="hljs-keyword">let</span> i = <span class="hljs-number">1</span>; i &lt;= <span class="hljs-number">15</span>; i++) {
          data.push({
            <span class="hljs-attr">key</span>: i,
            <span class="hljs-attr">label</span>: <span class="hljs-string">`Option <span class="hljs-subst">${ i }</span>`</span>,
            <span class="hljs-attr">disabled</span>: i % <span class="hljs-number">4</span> === <span class="hljs-number">0</span>
          });
        }
        <span class="hljs-keyword">return</span> data;
      };
      <span class="hljs-keyword">return</span> {
        <span class="hljs-attr">data</span>: generateData(),
        <span class="hljs-attr">value3</span>: [<span class="hljs-number">1</span>],
        renderFunc(h, option) {
          <span class="hljs-keyword">return</span> <span class="xml"><span class="hljs-tag">&lt;<span class="hljs-name">span</span>&gt;</span>{ option.key } - { option.label }<span class="hljs-tag">&lt;/<span class="hljs-name">span</span>&gt;</span></span>;
        }
      };
    },

    <span class="hljs-attr">methods</span>: {
      handleChange(value, direction, movedKeys) {
        <span class="hljs-built_in">console</span>.log(value, direction, movedKeys);
      }
    }
  };
</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>
</code></pre>
</div></demo-block>
<h3 id="prop-aliases"><a class="header-anchor" href="#prop-aliases" aria-hidden="true">¶</a> Prop aliases</h3>
<p>By default, Transfer looks for <code>key</code>, <code>label</code> and <code>disabled</code> in a data item. If your data items have different key names, you can use the <code>props</code> attribute to define aliases.</p>
<demo-block class="demo-box" :jsfiddle="{&quot;html&quot;:&quot;&lt;template&gt;\n  &lt;el-transfer v-model=\&quot;value4\&quot; :props=\&quot;{\n      key: 'value',\n      label: 'desc'\n    }\&quot; :data=\&quot;data3\&quot;&gt;\n  &lt;/el-transfer&gt;\n&lt;/template&gt;\n\n\n&quot;,&quot;script&quot;:&quot;\n  export default {\n    data() {\n      const generateData3 = _ =&gt; {\n        const data = [];\n        for (let i = 1; i &lt;= 15; i++) {\n          data.push({\n            value: i,\n            desc: `Option ${ i }`,\n            disabled: i % 4 === 0\n          });\n        }\n        return data;\n      };\n      return {\n        data3: generateData3(),\n        value4: []\n      };\n    }\n  };\n&quot;,&quot;style&quot;:null}">
                    <div class="source" slot="source"><template>
  <el-transfer v-model="value4" :props="{
      key: 'value',
      label: 'desc'
    }" :data="data3">
  </el-transfer>
</template>


</div>
                    <p>The data items in this example do not have <code>key</code>s or <code>label</code>s, instead they have <code>value</code>s and <code>desc</code>s. So you need to set aliases for <code>key</code> and <code>label</code>.</p>

                    <div class="highlight" slot="highlight"><pre><code class="hljs language-html"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>
  <span class="hljs-tag">&lt;<span class="hljs-name">el-transfer</span>
    <span class="hljs-attr">v-model</span>=<span class="hljs-string">"value4"</span>
    <span class="hljs-attr">:props</span>=<span class="hljs-string">"{
      key: 'value',
      label: 'desc'
    }"</span>
    <span class="hljs-attr">:data</span>=<span class="hljs-string">"data3"</span>&gt;</span>
  <span class="hljs-tag">&lt;/<span class="hljs-name">el-transfer</span>&gt;</span>
<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>

<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">
  <span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {
    data() {
      <span class="hljs-keyword">const</span> generateData3 = <span class="hljs-function"><span class="hljs-params">_</span> =&gt;</span> {
        <span class="hljs-keyword">const</span> data = [];
        <span class="hljs-keyword">for</span> (<span class="hljs-keyword">let</span> i = <span class="hljs-number">1</span>; i &lt;= <span class="hljs-number">15</span>; i++) {
          data.push({
            <span class="hljs-attr">value</span>: i,
            <span class="hljs-attr">desc</span>: <span class="hljs-string">`Option <span class="hljs-subst">${ i }</span>`</span>,
            <span class="hljs-attr">disabled</span>: i % <span class="hljs-number">4</span> === <span class="hljs-number">0</span>
          });
        }
        <span class="hljs-keyword">return</span> data;
      };
      <span class="hljs-keyword">return</span> {
        <span class="hljs-attr">data3</span>: generateData3(),
        <span class="hljs-attr">value4</span>: []
      };
    }
  };
</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>
</code></pre>
</div></demo-block>
<h3 id="attributes"><a class="header-anchor" href="#attributes" aria-hidden="true">¶</a> Attributes</h3>
<table class="table"><thead>
<tr>
<th>Attribute</th>
<th>Description</th>
<th>Type</th>
<th>Accepted Values</th>
<th>Default</th>
</tr>
</thead>
<tbody>
<tr>
<td>data</td>
<td>data source</td>
<td>array[{ key, label, disabled }]</td>
<td>—</td>
<td>[ ]</td>
</tr>
<tr>
<td>filterable</td>
<td>whether Transfer is filterable</td>
<td>boolean</td>
<td>—</td>
<td>false</td>
</tr>
<tr>
<td>filter-placeholder</td>
<td>placeholder for the filter input</td>
<td>string</td>
<td>—</td>
<td>Enter keyword</td>
</tr>
<tr>
<td>filter-method</td>
<td>custom filter method</td>
<td>function</td>
<td>—</td>
<td>—</td>
</tr>
<tr>
<td>titles</td>
<td>custom list titles</td>
<td>array</td>
<td>—</td>
<td>['List 1', 'List 2']</td>
</tr>
<tr>
<td>button-texts</td>
<td>custom button texts</td>
<td>array</td>
<td>—</td>
<td>[ ]</td>
</tr>
<tr>
<td>render-content</td>
<td>custom render function for data items</td>
<td>function(h, option)</td>
<td>—</td>
<td>—</td>
</tr>
<tr>
<td>footer-format</td>
<td>texts for checking status in list footer</td>
<td>object{noChecked, hasChecked}</td>
<td>—</td>
<td>{ noChecked: '${total} items', hasChecked: '${checked}/${total} checked' }</td>
</tr>
<tr>
<td>props</td>
<td>prop aliases for data source</td>
<td>object{key, label, disabled}</td>
<td>—</td>
<td>—</td>
</tr>
<tr>
<td>left-default-checked</td>
<td>key array of initially checked data items of the left list</td>
<td>array</td>
<td>—</td>
<td>[ ]</td>
</tr>
<tr>
<td>right-default-checked</td>
<td>key array of initially checked data items of the right list</td>
<td>array</td>
<td>—</td>
<td>[ ]</td>
</tr>
</tbody>
</table>
<h3 id="slot"><a class="header-anchor" href="#slot" aria-hidden="true">¶</a> Slot</h3>
<table class="table"><thead>
<tr>
<th>Name</th>
<th>Description</th>
</tr>
</thead>
<tbody>
<tr>
<td>left-footer</td>
<td>content of left list footer</td>
</tr>
<tr>
<td>right-footer</td>
<td>content of right list footer</td>
</tr>
</tbody>
</table>
<h3 id="events"><a class="header-anchor" href="#events" aria-hidden="true">¶</a> Events</h3>
<table class="table"><thead>
<tr>
<th>Event Name</th>
<th>Description</th>
<th>Parameters</th>
</tr>
</thead>
<tbody>
<tr>
<td>change</td>
<td>triggers when data items change in the right list</td>
<td>key array of current data items in the right list, transfer direction (left or right), moved item keys</td>
</tr>
</tbody>
</table>
</section></template>
<style>
  .demo-transfer {
    .transfer-footer {
      margin-left: 20px;
      padding: 6px 5px;
    }
  }
</style>
<script>
  export default {
    data() {
      const generateData = _ => {
        const data = [];
        for (let i = 1; i <= 15; i++) {
          data.push({
            key: i,
            label: `Option ${ i }`,
            disabled: i % 4 === 0
          });
        }
        return data;
      };
      const generateData2 = _ => {
        const data = [];
        const states = ['California', 'Illinois', 'Maryland', 'Texas', 'Florida', 'Colorado', 'Connecticut '];
        const initials = ['CA', 'IL', 'MD', 'TX', 'FL', 'CO', 'CT'];
        states.forEach((city, index) => {
          data.push({
            label: city,
            key: index,
            initial: initials[index]
          });
        });
        return data;
      };
      const generateData3 = _ => {
        const data = [];
        for (let i = 1; i <= 15; i++) {
          data.push({
            value: i,
            desc: `Option ${ i }`,
            disabled: i % 4 === 0
          });
        }
        return data;
      };
      return {
        data: generateData(),
        data2: generateData2(),
        data3: generateData3(),
        value1: [1, 4],
        value2: [],
        value3: [1],
        value4: [],
        filterMethod(query, item) {
